static int
format_decoder (const xtensa_insnbuf insn)
{
  if ((insn[0] & 0x8) == 0 && (insn[1] & 0) == 0 && (insn[2] & 0) == 0)
    return 0; /* x24 */
  if ((insn[0] & 0xc) == 0x8 && (insn[1] & 0) == 0 && (insn[2] & 0) == 0)
    return 1; /* x16a */
  if ((insn[0] & 0xe) == 0xc && (insn[1] & 0) == 0 && (insn[2] & 0) == 0)
    return 2; /* x16b */
  if ((insn[0] & 0x1f) == 0x1f && (insn[1] & 0) == 0 && (insn[2] & 0) == 0)
    return 3; /* ae_format88 */
  if ((insn[0] & 0x3f) == 0xf && (insn[1] & 0) == 0 && (insn[2] & 0xff0000) == 0)
    return 4; /* ae_format88_2 */
  if ((insn[0] & 0xf) == 0xe && (insn[1] & 0xc000) == 0xc000 && (insn[2] & 0) == 0)
    return 5; /* ae_format48 */
  if ((insn[0] & 0xf) == 0xe && (insn[1] & 0xc000) == 0x8000 && (insn[2] & 0) == 0)
    return 6; /* ae_format48_2 */
  if ((insn[0] & 0xf) == 0xe && (insn[1] & 0x8000) == 0 && (insn[2] & 0) == 0)
    return 7; /* ae_format48_3 */
  if ((insn[0] & 0x3f) == 0xf && (insn[1] & 0) == 0 && (insn[2] & 0xffffe0) == 0x11000)
    return 8; /* ae_format88_3 */
  if ((insn[0] & 0x3f) == 0xf && (insn[1] & 0) == 0 && (insn[2] & 0xfff000) == 0x10000)
    return 9; /* ae_format88_4 */
  return -1;
}

